import React from "react";

const HomeWork = () =>{
    return(
        <section className="homework">
        <div className="container">
            <h4>How We Work</h4>
            <h3>Media Library</h3>
            <p>Discover the latest media library or read client reviews for expert analysis on industry trends and development.</p>
        </div>

        </section>

    )
}

export default HomeWork;
